import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const Home = () => {
    const [matches, setMatches] = useState([]);

    useEffect(() => {
        axios.get(`${process.env.REACT_APP_API_BASE_URL}`)
            .then(response => setMatches(response.data.results))
            .catch(error => console.log(error));
    }, []);

    return (
        <div>
            <h1>Live Matches</h1>
            <ul>
                {matches.map(match => (
                    <li key={match.sport_event.id}>
                        <Link to={`/bet/${match.sport_event.id}`}>
                            {match.sport_event.season.name} - {match.sport_event_status.display_score}
                        </Link>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Home;
